import React from "react";

function About() {
  const style = {
    backgroundColor: "black",
    // background: "transparent",
    color: "white",

    fontSize: "3rem",
    // textAlign: "center",
    width: "100%",
    padding: "1rem",
  };
  return <h1 style={style}>This is the about page.</h1>;
}

export default About;
